import React , { useState,useEffect } from 'react';
import GoogleMapReact from 'google-map-react'

const Map = props => {
  const latitude = 34.997724;// 緯度
  const longitude = 135.913759;// 経度
  const API_KEY = process.env.REACT_APP_MAP_API_KEY;

  useEffect(()=>{
    console.log(latitude);
    console.log(longitude);
    console.log(API_KEY);
  })
  return (
    <section className="map">
          <GoogleMapWrapper>
      <GoogleMapReact
        bootstrapURLKeys={{
          key: {API_KEY}
        }}
        defaultCenter={{
          lat: 43.0582954,
          lng: 141.3466919
        }}
        defaultZoom={15}
      >
        <Pin
          lat={43.0582954}
          lng={141.3466919}
        >
        おおおんどおり
        </Pin>
      </GoogleMapReact>
      </GoogleMapWrapper>
    </section>
  );
}

export default Map;
